              <Header />
            </div>
            <div className="col-md-3 col-0" >

            </div>

            <div className="col-md-6 col-12">



              <h3 style={{color:"#145CA8",fontFamily:"PoppinsSemiBold"}} className="pt-5">Binusian Posts</h3>
              <div style={{display:"flex",flexWrap:"wrap"}}>
                <form style={{paddingBottom:"10px"}}>
                  <div className="mb-3 mt-4">
                      <label for="exampleInputEmail1" className="form-label" style={{fontFamily:"PoppinsRegular"}}>Share something</label>
                      <input type="text" className="form-control" id="exampleInputEmail1" aria-describedby="emailHelp"/>
                  </div>
                  <div style={{textAlign:"right"}}>
                    <button type="submit" className="btn btn-success  ml-2" style={{fontFamily:"PoppinsRegular"}}>Post</button>
                  </div>

                </form>   

              </div>

              <Post />
              <Post />
              <Post />
              <Post />



            </div>

            <div className="col-md-3 col-0" >

            </div>
          </div>

          {/*<p>test</p>*/}


        </div>
      )
  }
}

export default HomePage;
